%[text] ## Exercise 2.8
% Define RK2 function
function [t, y] = rk2(f, tspan, y0, h)

nsteps = floor((tspan(2) - tspan(1)) / h);
m = length(y0);
t = zeros(nsteps + 1, 1);
y = zeros(nsteps + 1, m);
t(1) = tspan(1);
y(1,:) = y0;

for n = 1 : length(t) - 1
    k1 = f(t(n), y(n,:));
    k2 = f(t(n) + 3/4 * h, y(n,:) + 3/4 * h * k1);
    y(n+1,:) = y(n,:) + h / 3 * (k1 + 2 * k2);
    t(n+1) = t(n) + h;
end

end

% Define ODE function
f = @(t, y) t - y;

% Define IVP parameters
tspan = [0, 2]; % boundaries of the t domain
y0 = 1;         % initial values
h = 0.4;        % step length

% Solve IVP
[t, y] = rk2(f, tspan, y0, h);

% Calculate exact solution
exact = @(t) t + 2 * exp(-t) - 1;
texact = linspace(tspan(1), tspan(2), 100);
yexact = exact(texact);

% Plot solution
clf %[output:5a257d51]
hold on %[output:5a257d51]
plot(texact, yexact, 'k'); %[output:5a257d51]
plot(t, y, 'b-o', MarkerFaceColor='b'); %[output:5a257d51]
hold off %[output:5a257d51]
xlabel('$x$', Interpreter='latex') %[output:5a257d51]
ylabel('$y(t)$', Interpreter='latex') %[output:5a257d51]
title('$y = t - y$, $y(0) = 1$', Interpreter='latex') %[output:5a257d51]
legend('Exact', 'RK2', Location='NorthWest') %[output:5a257d51]
axis padded %[output:5a257d51]
