%[text] ## Exercise 2.9
% Define RK3 function
function [t, y] = rk3(f, tspan, y0, h)

nsteps = floor((tspan(2) - tspan(1)) / h);
m = length(y0);
t = zeros(nsteps + 1, 1);
y = zeros(nsteps + 1, m);
t(1) = tspan(1);
y(1,:) = y0;

for n = 1 : length(t) - 1
    k1 = f(t(n), y(n,:));
    k2 = f(t(n) + 1/2 * h, y(n,:) + 1/2 * h * k1);
    k3 = f(t(n) + h, y(n,:) + h * (-k1 + 2 * k2));
    y(n+1,:) = y(n,:) + h / 6 * (k1 + 4 * k2 + k3);
    t(n+1) = t(n) + h;
end

end

% Define RK4 function
function [t, y] = rk4(f, tspan, y0, h)

nsteps = floor((tspan(2) - tspan(1)) / h);
m = length(y0);
t = zeros(nsteps + 1, 1);
y = zeros(nsteps + 1, m);
t(1) = tspan(1);
y(1,:) = y0;

for n = 1 : length(t) - 1
    k1 = f(t(n), y(n,:));
    k2 = f(t(n) + 1/3 * h, y(n,:) + 1/3 * h * k1);
    k3 = f(t(n) + 1/2 * h, y(n,:) + h * (1/8 * k1 + 3/8 * k2));
    k4 = f(t(n) + h, y(n,:) + h * (1/2 * k1 - 3/2 * k2 + 2 * k3));
    y(n+1,:) = y(n,:) + h / 6 * (k1 + 4 * k3 + k4);
    t(n+1) = t(n) + h;
end

end

% Solve IVP
[t, y_rk2] = rk2(f, tspan, y0, h);
[t, y_rk3] = rk3(f, tspan, y0, h);
[t, y_rk4] = rk4(f, tspan, y0, h);

% Calculate exact solution
exact = @(t) t + 2 * exp(-t) - 1;
texact = linspace(tspan(1), tspan(2), 100);
yexact = exact(texact);

% Plot solution
clf %[output:169fda16]
hold on %[output:169fda16]
plot(texact, yexact, 'k'); %[output:169fda16]
plot(t, y_rk2, 'b-o', MarkerFaceColor='b'); %[output:169fda16]
plot(t, y_rk3, 'r-o', MarkerFaceColor='r'); %[output:169fda16]
plot(t, y_rk4, 'g-o', MarkerFaceColor='g'); %[output:169fda16]
hold off %[output:169fda16]
xlabel('$x$', Interpreter='latex') %[output:169fda16]
ylabel('$y(t)$', Interpreter='latex') %[output:169fda16]
title('$y = t - y$, $y(0) = 1$', Interpreter='latex') %[output:169fda16]
legend('Exact', 'RK2', 'RK3', 'RK4', Location='NorthWest') %[output:169fda16]
axis padded %[output:169fda16]
