%[text] ## Exercise 2.10
% Loop through h values and calculate global truncation errors
hvals = [0.4, 0.2, 0.1, 0.05];
error_rk2 = zeros(1, length(hvals));
error_rk3 = zeros(1, length(hvals));
error_rk4 = zeros(1, length(hvals));
for i = 1 : length(hvals)
    [t, y_rk2] = rk2(f, tspan, y0, hvals(i));
    [t, y_rk3] = rk3(f, tspan, y0, hvals(i));
    [t, y_rk4] = rk4(f, tspan, y0, hvals(i));
    [~, idx] = min(abs(t - 2));
    error_rk2(i) = abs(exact(2) - y_rk2(idx,1));
    error_rk3(i) = abs(exact(2) - y_rk3(idx,1));
    error_rk4(i) = abs(exact(2) - y_rk4(idx,1));
end

% Print table
if true % to keep printed lines together %[output:group:1249f547]
    fprintf('|   h   |   RK2    |   RK3    |   RK4    |') %[output:60f80d61]
    fprintf('|:-----:|:--------:|:--------:|:--------:|') %[output:3d498552]
    for i = 1 : length(hvals)
        fprintf('| %0.3f | %1.2e | %1.2e | %1.2e |\n', hvals(i), error_rk2(i), error_rk3(i), error_rk4(i)) %[output:4e261ead]
    end
end %[output:group:1249f547]
% Plot errors
hold on %[output:903a0fbb]
hplot(1) = loglog(hvals, error_rk2, 'b-o', MarkerFaceColor='b'); %[output:903a0fbb]
hplot(2) = loglog(hvals, error_rk3, 'r-o', MarkerFaceColor='r'); %[output:903a0fbb]
hplot(3) = loglog(hvals, error_rk4, 'g-o', MarkerFaceColor='g'); %[output:903a0fbb]
hold off %[output:903a0fbb]
xlabel('$h$', Interpreter='latex') %[output:903a0fbb]
ylabel('global truncation error') %[output:903a0fbb]
legend(hplot, {'RK2', 'RK3', 'RK4'}, Location='SouthEast') %[output:903a0fbb]
% Estimate errors
if true % to keep printed lines together %[output:group:1f90236e]
fprintf('RK2: n = %0.2f', (log(error_rk2(1)) - log(error_rk2(end))) / (log(hvals(1)) - log(hvals(end)))) %[output:2ae81089]
fprintf('RK3: n = %0.2f', (log(error_rk3(1)) - log(error_rk3(end))) / (log(hvals(1)) - log(hvals(end)))) %[output:064549d2]
fprintf('RK4: n = %0.2f', (log(error_rk4(1)) - log(error_rk4(end))) / (log(hvals(1)) - log(hvals(end)))) %[output:441cc9cb]
end %[output:group:1f90236e]
