%[text] ## Exercise 2.11
function [t, y] = rk23(f, tspan, y0, atol, rtol)

m = length(y0);
t = zeros(100000, 1);
y = zeros(100000, m);
t(1) = tspan(1);
y(1,:) = y0;

h = 0.8 * rtol ^ (1/3);
n = 1;
nfail = 0;
while t(n) < tspan(2)

    k1 = f(t(n), y(n,:));
    k2 = f(t(n) + 1/2 * h, y(n,:) + 1/2 * h * k1);
    k3 = f(t(n) + h, y(n,:) + h * (-k1 + k2)); 
    y3 = y(n,:) + h / 6 * (k1 + 4 * k2 + k3); 
    y2 = y(n,:) + h * k2;

    delta = norm(y3 - y2);
    tol = atol + rtol * min(abs(y3));
    if delta < tol
        y(n+1,:) = y3;
        t(n+1) = t(n) + h;
        n = n + 1;
    else
        nfail = nfail + 1;
    end

    r = max(0.1, 0.8 * (tol / delta) ^ (1/3));
    h = min(r * h, tspan(2) - t(n));
end

t(n+1:end) = [];
y(n+1:end,:) = [];

fprintf('Number of successful steps:     %i\n', n - 1)
fprintf('Number of failed steps:         %i\n', nfail)
fprintf('Number of function evaluations: %i\n', (n - 1 + nfail) * 3)

end

% Solve IVP
atol = 1e-6;
rtol = 1e-3;
[t, y] = rk23(f, tspan, y0, atol, rtol); %[output:89f0c7ff]
% Plot solution
clf %[output:0f7cfd61]
hold on %[output:0f7cfd61]
plot(texact, yexact, 'k') %[output:0f7cfd61]
plot(t, y, 'b-o', MarkerFaceColor='b') %[output:0f7cfd61]
hold off %[output:0f7cfd61]
xlabel('$x$', Interpreter='latex') %[output:0f7cfd61]
ylabel('$y(t)$', Interpreter='latex') %[output:0f7cfd61]
title('$y = t - y$, $y(0) = 1$', Interpreter='latex') %[output:0f7cfd61]
legend('Exact', 'RK3(2)', Location='NorthWest') %[output:0f7cfd61]
